  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lacreek Migratory
  Waterfowl Refuge outlines Refuge accomplishments from September through December
  of 1942. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and wildfires during this period. Wildlife- including migratory
  birds, upland game birds, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, and collections and receipts. Resource management is outlined; topics
  include haying and fur harvesting. A progress report on field investigations and
  applied research is also provided. The public relations section discusses recreational
  uses, Refuge visitors, and hunting. Photographs and N-R forms are attached.\",\n\t\"owner_org\":
